import React from "react";
import { connect } from "react-redux";
import { StyledBurger } from "./StyledBurger";
import { setLeftSidebar } from "../../reducers/navigationReducer";

const Burger = ({ leftSidebarOpen, setLeftSidebar, customClass }) => {
  const handleClick = () => {
    setDropdown(CONSTANTS.DROPDOWNS.USERNAME, false);
    setLeftSidebar(!leftSidebarOpen);
  };
  return (
    <div onClick={handleClick} className={customClass}>
      <StyledBurger open={leftSidebarOpen}>
        <div />
        <div />
        <div />
      </StyledBurger>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    leftSidebarOpen: state.navigation.sidebarOpen.left,
  };
};

const mapDispatchToProps = {
  setLeftSidebar,
};

export default connect(mapStateToProps, mapDispatchToProps)(Burger);
